package com.codex.eduapp.network.models;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class GetStudents {	public class Datum {		@SerializedName("id")		@Expose		private Integer id;		@SerializedName("student_name")		@Expose		private String studentName;		@SerializedName("mobile")		@Expose		private String mobile;		@SerializedName("email")		@Expose		private String email;		@SerializedName("section_id")		@Expose		private Integer sectionId;		@SerializedName("section_name")		@Expose		private String sectionName;		@SerializedName("profile_pic")		@Expose		private String profilePic;		public Integer getId() {			return id;		}		public void setId(Integer id) {			this.id = id;		}		public String getStudentName() {			return studentName;		}		public void setStudentName(String studentName) {			this.studentName = studentName;		}		public String getMobile() {			return mobile;		}		public void setMobile(String mobile) {			this.mobile = mobile;		}		public String getEmail() {			return email;		}		public void setEmail(String email) {			this.email = email;		}		public Integer getSectionId() {			return sectionId;		}		public void setSectionId(Integer sectionId) {			this.sectionId = sectionId;		}		public String getSectionName() {			return sectionName;		}		public void setSectionName(String sectionName) {			this.sectionName = sectionName;		}		public String getProfilePic() {			return profilePic;		}		public void setProfilePic(String profilePic) {			this.profilePic = profilePic;		}	}	public class Get_Students {		@SerializedName("success")		@Expose		private String success;		@SerializedName("errors")		@Expose		private Object errors;		@SerializedName("message")		@Expose		private String message;		@SerializedName("data")		@Expose		private List<Datum> data = null;		public String getSuccess() {			return success;		}		public void setSuccess(String success) {			this.success = success;		}		public Object getErrors() {			return errors;		}		public void setErrors(Object errors) {			this.errors = errors;		}		public String getMessage() {			return message;		}		public void setMessage(String message) {			this.message = message;		}		public List<Datum> getData() {			return data;		}		public void setData(List<Datum> data) {			this.data = data;		}	}}